import React, { useState, useEffect } from 'react';
import { audioService, AudioData } from '../lib/supabase';

const AudioPlayer = () => {
  const [audios, setAudios] = useState<AudioData[]>([]);

  useEffect(() => {
    loadAudios();
  }, []);

  const loadAudios = async () => {
    try {
      const data = await audioService.getAudios();
      setAudios(data);
    } catch (error) {
      console.error('Erro ao carregar áudios:', error);
    }
  };

  return (
    <div className="bg-white rounded-lg shadow p-4">
      <h2 className="text-xl font-semibold mb-4">Lista de Áudios</h2>
      <div className="space-y-4">
        {audios.map((audio) => (
          <div key={audio.id} className="p-4 border rounded">
            <h3 className="font-medium">{audio.title}</h3>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AudioPlayer;
